import React from "react";

import logo from '../../Assets/images/banner-4.jpeg'
import Slider from "react-slick";

export default function MainSlider() {
 
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
     return (
    
      <div className="container">
        <Slider {...settings}>
          <img src={logo} alt="" />
          <img src={logo} alt="" />
          <img src={logo} alt="" />
          <img src={logo} alt="" />

        </Slider>
     
  </div>
  );
}
